                "instructions": "\u003Ch3\u003EHow to do a side plank high pull:\u003C/h3\u003E\u003Cul\u003E\u003Cli\u003EFirstly, assume a high side plank position: feet stacked, bottom arm extended, torso in a straight line from shoulders to hips.\u003C/li\u003E\u003Cli\u003EThen, position one end of a band under your planted hand and hold onto the other end with your free hand.\u003C/li\u003E\u003Cli\u003EThe starting position is with top elbow bend, band loose.\u003C/li\u003E\u003Cli\u003EInitiate the movement by raising your elbow and pulling the band tight.\u003C/li\u003E\u003Cli\u003ENow, pull as far as possible, while maintaining your form in the high side plank position.\u003C/li\u003E\u003C/ul\u003E",
